import React from 'react';
import { useParams } from 'react-router-dom';
import {
  Container,
  Typography,
  Card,
  CardContent,
  Avatar,
  List,
  ListItem,
  ListItemText,
  IconButton,
} from '@mui/material';
import { Male as MaleIcon, Female as FemaleIcon, SaveAlt as SaveAltIcon } from '@mui/icons-material';
import jsPDF from 'jspdf';
import './PatientProfile.css';

const PatientProfile = () => {
  const { uuid } = useParams();
  const [patient, setPatient] = React.useState(null);

  React.useEffect(() => {
    const fetchPatient = async () => {
      const response = await fetch(`http://localhost:5000/api/patients/${uuid}`, {
        method: 'GET',
        credentials: 'include',
      });
      const data = await response.json();
      setPatient(data);
    };

    fetchPatient();
  }, [uuid]);

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.setFontSize(18);
    doc.text(`Cartella Clinica di ${patient.nominativo}`, 20, 20);

    doc.setFontSize(14);
    doc.text('Informazioni del Paziente', 20, 30);
    doc.setFontSize(12);
    doc.text(`Nome: ${patient.nominativo}`, 20, 40);
    doc.text(`Et√†: ${patient.eta}`, 20, 50);
    doc.text(`Altezza: ${patient.altezza}`, 20, 60);
    doc.text(`Peso: ${patient.peso}`, 20, 70);
    doc.text(`Sesso: ${patient.sesso}`, 20, 80);

    // Aggiungi altre informazioni come misurazioni, trattamenti, patologie
    // ...

    doc.save(`Cartella_Clinica_${patient.nominativo}.pdf`);
  };

  if (!patient) {
    return <Typography>Loading...</Typography>;
  }

  return (
    <Container>
      <div className="patient-profile-header">
        <Avatar className="patient-avatar">
          {patient.sesso === 'maschio' ? <MaleIcon /> : <FemaleIcon />}
        </Avatar>
        <div className="patient-info">
          <Typography variant="h4">{patient.nominativo}</Typography>
          <Typography>Et√†: {patient.eta}</Typography>
          <Typography>Altezza: {patient.altezza}</Typography>
          <Typography>Peso: {patient.peso}</Typography>
          <Typography>Sesso: {patient.sesso}</Typography>
        </div>
        <IconButton onClick={generatePDF} className="pdf-icon">
          <SaveAltIcon />
        </IconButton>
      </div>

      <Card className="patient-card">
        <CardContent>
          <Typography variant="h6">Informazioni del Paziente</Typography>
          <Typography>Nome: {patient.nominativo}</Typography>
          <Typography>Et√†: {patient.eta}</Typography>
          <Typography>Altezza: {patient.altezza}</Typography>
          <Typography>Peso: {patient.peso}</Typography>
          <Typography>Sesso: {patient.sesso}</Typography>
        </CardContent>
      </Card>

      <Card className="patient-card">
        <CardContent>
          <Typography variant="h6">Misurazioni</Typography>
          <List>
            {/* Esempio di dati fittizi */}
            <ListItem>
              <ListItemText primary="2024-06-20: 120/80" />
            </ListItem>
            <ListItem>
              <ListItemText primary="2024-06-21: 125/85" />
            </ListItem>
          </List>
        </CardContent>
      </Card>

      <Card className="patient-card">
        <CardContent>
          <Typography variant="h6">Trattamenti</Typography>
          <List>
            {/* Esempio di dati fittizi */}
            <ListItem>
              <ListItemText primary="2024-06-20: Antibiotics" />
            </ListItem>
            <ListItem>
              <ListItemText primary="2024-06-21: Physical Therapy" />
            </ListItem>
          </List>
        </CardContent>
      </Card>

      <Card className="patient-card">
        <CardContent>
          <Typography variant="h6">Patologie</Typography>
          <List>
            {/* Esempio di dati fittizi */}
            <ListItem>
              <ListItemText primary="Hypertension" />
            </ListItem>
            <ListItem>
              <ListItemText primary="Diabetes" />
            </ListItem>
          </List>
        </CardContent>
      </Card>
    </Container>
  );
};

export default PatientProfile;
